import { Stack, Typography } from "@mui/joy";

export default function UserInformationCard() {
  return (
    <Stack direction="row" sx={{ backgroundColor: "black" }}>
      <Stack direction="row">
        <Typography sx={{color:"yellow"}}>About Me</Typography>
      </Stack>
    </Stack>
  );
}
